Every night I answer in a chat with myself, these 10 questions. I got these ages ago and have always kept the list nearby. Paper>email>notes>meme 🌚

I use the invitations the questions provide to share with myself about the day, nibbling on my memories like a mouse with cheese. I think about what’s next, and I’m able to restore completely now that I’ve been lovingly heard. ♥️ I mean that’s all anyone wants, right? To be truly listened to. Offering this to yourself daily is a true dedication to self love that has a gorgeous return on investment. 
While thinking about the day ahead, I release the desire to judge me harshly or compare my day to anything outside my own happiness. Simply looking at what my best was, what I’d like more of, and then I get to go to sleep with pride, satisfaction, and completeness wrapped around me! 
I offer you these memes to freely screenshot and try it! I’ve been working with these questions almost 5 years now. It’s truly a gift to see myself as light and love each and every night. Take what you want, leave the rest for someone else, or even better: share the ideas you love. 🌻☀️❤️🌱🌴
